import React from 'react';

const menuStyle = {
    width: '40px',
    height: '40px',
    backgroundSize: 'cover',

    backgroundImage: 'url(data:image/png;base64,)',
    backgroundRepeat: 'no-repeat',
    border: 'none',
}

function Header() {
    return (
        <div className="header">
            <button style={ menuStyle } />
        </div>
    )
}

export default Header;
